import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { HttpClient, HttpClientModule, HTTP_INTERCEPTORS } from '@angular/common/http';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HeaderComponent } from './components/header/header.component';
import { AboutComponent } from './components/about/about.component';
import { EducationListComponent } from './components/education-list/education-list.component';
import { EducationItemComponent } from './components/education-item/education-item.component';
import { SkillListComponent } from './components/skill-list/skill-list.component';
import { SkillItemComponent } from './components/skill-item/skill-item.component';
import { MainComponent } from './components/main/main.component';
import { HomeComponent } from './components/home/home.component';
import { ContactComponent } from './components/contact/contact.component';
import { LoginComponent } from './components/login/login.component';
import { ReactiveFormsModule } from '@angular/forms';
import { DataService } from './services/data.service';
import { InterceptorService } from './services/interceptor.service';
import { ManageButtonsComponent } from './components/manage-buttons/manage-buttons.component';
import { ViewRef } from '@angular/core'; // Importa el servicio ViewRef
import { CommonModule } from '@angular/common';

@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    AboutComponent,
    EducationListComponent,
    EducationItemComponent,
    SkillListComponent,
    SkillItemComponent,
    MainComponent,
    HomeComponent,
    ContactComponent,
    LoginComponent,
    ManageButtonsComponent,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    ReactiveFormsModule,
    CommonModule
  ],
  providers: [
    DataService,
    ViewRef,
    {provide: HTTP_INTERCEPTORS, useClass: InterceptorService, multi: true}
  ],
  bootstrap: [AppComponent]
})
export class AppModule { }
